import React from 'react';

const Header = () => {
  return (
    <div>
      <div className="footer">
      </div>
      <style>{`
        .footer {
          background: black;
          height: 50px;
          width: 100px;
        }
      `}</style>
    </div>
  )
}

export default Header;
